}i:54;a:1:{s:12:"created_time";i:1599252892;}i:55;a:1:{s:7:"caption";s:1608:"Okay y'all... as you head into the holiday weekend, pause, read this, and REMEMBER IT.

Has anyone ever introduced themselves to you, and not even 10 seconds later you've already forgotten their name? Yeah... same... like, every time. Why is this happening to me you might ask? Let's talk it out.

Often times when we are listening, our brain is filtering how we can use the information to our advantage. Do we agree? Do we disagree? How can I best support this person? How can I convince them to be on my side??

This is problematic because when we are worried about our own response, we aren't being fully present. And when we aren't fully present, we miss info. And when we miss info, we can't POSSIBLY create the best response. Do you see the dizzying issue here?

Basically whether you are trying to make a good first impression, support someone through tough times or convince someone to take your side, your best bet is listening fully and taking your time to formulate your response. Taking a moment to respond does not make you weak or stupid; on the contrary it makes you compassionate & smart. So be compassionate, and be smart. Listen to understand what the other person is saying, NOT to formulate your comeback.

