ion";s:1946:"I‚Äôm in a weird place. 
On that confuses me. 
One that‚Äôs lonely and dark. 
One where I‚Äôm overwhelmed with gratitude and love. 
Parts of me are overwhelmed with loss. 
Begging Source to just give me the good things back. Pleading that I‚Äôm kind and good and that I don‚Äôt deserve to be punished. 
I‚Äôve been given a lot of shit to deal with my entire life. I‚Äôm only 21.
I‚Äôm sitting, wondering if I would have just ‚Äúbehaved‚Äù that I wouldn‚Äôt have ended up alone out of a breakup with newly formed PTSD. 
Or if I was good enough, I wouldn‚Äôt be sick. Or I wouldn‚Äôt be lonely. 
This thought is completely irrational. 
Source doesn‚Äôt have time to punish me. Source is love after all. 
As I sit here, listening to an EP that was written about loss. Grief. Hope. Desire. 
I‚Äôm reminded of how grateful I am to finally be in a place where Fletchers EP can heal me too. 
I can‚Äôt explain how much her and her music mean to me. I don‚Äôt have the words. 
But I‚Äôm overwhelmed with love and loss. I‚Äôm grateful to even be in a place where my pain is universal. 
I wish I had the words to describe how much I loved. The way I recklessly love and adore people. 
This EP feels like someone else who finally gets it. A place where I‚Äôm not told to ‚Äújust move on‚Äù or ‚Äújust forget her.‚Äù
I‚Äôve never understood how people can just forget something so catastrophic. Love. Loss. It paints each of us with scars. Every one of us has begged for something better. To just have love back. To just be given a second chance. To be able to replay it all. 
What I wouldn‚Äôt give to have it all back again. That feeling of someone loving you is truly impossible to replicate in other places. But this EP feels like my chance. My goodbye. My deep, messy, loving feelings getting sealed up and sent back to Source. I‚Äôm in a weird place. But I‚Äôm overwhelmed with love and gratitude to not be going though it alone. #courage #carifletcher";}i:82;a:1:{s:14:"comments_count";i:0;}i:83;a:1:{s:11:"likes_count";i:0;}i:84;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuo-lVA0ii";}i:85;a:1:{s:5:"image";s:259:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118918060_209918780465538_6446645370443419023_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=106&_nc_ohc=1ersIt31sawAX9dNd1o&_nc_tp=15&oh=590832e61ec5d0e87f2a1fe832e8740a&oe=5F7DEE82";}i:86;a:1:{s:4:"type";s:5:"image";}i:87;a:1:{s:8:"owner_id";i:17453558357;}i:88;a:1:{s:14:"owner_username";s:0:"";}i:89;a:1:{s:14:"owner_fullname";s:0:"";}i:90;a:1:{s:9:"owner_pic";s:0:"";}i:91;a:1:{s:2:"id";s:19:"2391028545302772022";}i:92;a:1:{s:10:"short_code";s:11:"CEuo8sylzk2";}i:93;a:1:{s:12:"created_time";i:1599252835;}i:94;a:1:{s:7:"caption";s:335:"Meditate and reflect! üôèüèº

